import React from 'react';
import { useHistory } from 'react-router-dom'

export default function HomePage() {
  let history = useHistory();

  if(localStorage.getItem('user')){
    history.push(`/auth`)
  }

  return (
    <div style={{ textAlign: 'center', margin: 'auto', marginTop: '35vh' }} >
      <p>Home!</p>
    </div>
  );
}
